import React, { useEffect, useState } from "react";
import '../../App.css';
import axios from 'axios';
import {Container, CardTitle, CardText, Row, Col} from "reactstrap";

import { Images } from "./Images";


const Banner = () => {

    const [images, setImages] = useState([]);

    const fetchAPI = async()=>{
        const response = await axios.get('https://api.unsplash.com/search/photos/?client_id=lWaadUjJBoVg_DtoJm9aWBgufk1TNKxWA_zaAjdHFvM&query=people');
        const data = await response.data;
        setImages(data);
    }

    return (
        <div>
            <button className="btn btn-primary btn-md"                
                onLoad={fetchAPI}> Fetch API</button>
                <div className='photos'>
                    {images.lenght>0&&(
                        <Images images={images}/>
                    )}
                </div>
             <Container>
                <Row>
                    <Col className="bg-light border big" >
                    <button className="btn btn-primary btn-md"                
                onLoad={fetchAPI}> Fetch API</button>
                <div className='photos'>
                    {images.lenght>0&&(
                        <Images images={images}/>
                    )}
                </div>
                    </Col>

                    <Col className="bg-light border">
                    <div></div>
                    <div></div>
                    </Col>

                    <Col className="bg-light border">
                    <div></div>
                    </Col>

                    <Col className="bg-light border">
                    <div></div>
                    <div></div>
                    </Col>

                    <Col className="bg-light border">
                    <div></div>
                    </Col>

                    <Col className="bg-light border">
                    <div></div>
                    </Col>

                    <Col className="bg-light border">
                    <div></div>
                    <div></div>
                    </Col>
                </Row>
            </Container> 

        </div>
    );
};

export default Banner;
